import React, { useState } from 'react';
import './DrivingRange.css';

function DrivingRange() {
  const [date, setDate] = useState('');
  const [startTime, setStartTime] = useState('');
  
  const reservations = [
    {
      id: 1,
      date: 'Tuesday, May 2',
      time: '10:30 AM',
      duration: '2 hours'
    },
    {
      id: 2,
      date: 'Friday, May 5',
      time: '2:00 PM',
      duration: '1 hour'
    },
    {
      id: 3,
      date: 'Sunday, May 7',
      time: '8:00 AM',
      duration: '3 hours'
    }
  ];

  const handleManage = (id) => {
    // Handle manage button click
    console.log('Managing reservation:', id);
  };

  const handleBookSlot = (e) => {
    e.preventDefault();
    // Handle booking submission
    console.log('Booking slot:', { date, startTime });
  };

  return (
    <div className="driving-range-page">
      <h1>Driving Range</h1>
      <p className="subtitle">Book some time on the range and get some practice in!</p>

      <section className="reservations-section">
        <h2>My Reservations</h2>
        <div className="reservations-list">
          {reservations.map((reservation) => (
            <div key={reservation.id} className="reservation-item">
              <span className="reservation-info">
                {`${reservation.date} - ${reservation.time} (${reservation.duration})`}
              </span>
              <button 
                className="manage-button"
                onClick={() => handleManage(reservation.id)}
              >
                Manage
              </button>
            </div>
          ))}
        </div>
      </section>

      <section className="booking-section">
        <h2>Book a Slot</h2>
        <form onSubmit={handleBookSlot} className="booking-form">
          <div className="form-row">
            <div className="form-group">
              <label>Date</label>
              <input
                type="text"
                value={date}
                onChange={(e) => setDate(e.target.value)}
                placeholder="mm/dd/yyyy"
              />
            </div>
            <div className="form-group">
              <label>Start Time</label>
              <input
                type="text"
                value={startTime}
                onChange={(e) => setStartTime(e.target.value)}
                placeholder="--:-- --"
              />
            </div>
          </div>
        </form>
      </section>
    </div>
  );
}

export default DrivingRange;
